  .footer__social-links {
    display: inline-block;
    justify-content: flex-end;
    align-items: flex-end;
  }
  .footer__position--first {
    display: flex;
    flex-direction: row;
    justify-content: space-between;
  }
  .footer__position--second {
    display: flex;
    flex-direction: column;
  }
}

