    line-height: 30px;
  }

  //MODAL//
}
.backdrop-contacts {
  position: fixed;
  left: 0;
  top: 0;
  width: 100%;
  height: 100%;
  background-color: rgba(0 0 0 / 0.5);
  transition: transform 0.25s;
  z-index: 999;
}
.is-hidden-contacts {
  transform: translateX(-100%);
}
.modal-contacts {
  width: 80%;
  height: 70%;
  background-color: var(--background-mobile-menu);
  position: relative;
